script: |
  super -f text -I q10437.spq | sort > q10437.out

inputs:
  - name: q10437.spq
    data: |
      SELECT - col2 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT 24 IN ( - + 78 - + 30 + + - 65 / + col1 + - ( - col0 ) * col2 );
  - name: tab0

outputs:
  - name: q10437.out
    data: |
      -10
      -47
      -99
